import React from "react";
import {Link} from "react-router-dom"

const HomePage = () => {
    return (
        <div>
        <header className="App-header">
          Home Page <br></br>
          <br />
        <h6><Link to ={'/about'}About Page /></h6>
        <h6><Link to ={'/contact'}Contact Page /></h6>
        </header>
      </div>
    )
}

export default HomePage;
